import React from "react";
import clsx from 'clsx';
import Button from 'react-bootstrap/Button';

import photographer from "../assets/pexels-luis-quintero-1759531.jpg";

const ServicesList = [
    {
        title:"Drone Shots",
        imageLink:{photographer},
        text: "Get Drone shots for your airbnb so guests can see all the angles!",
        buttonLink: "#droneshots",
    },
]


function CustomServices(){
    return(
        <div className="container">
            <div className="row justify-content-between">
            {ServicesList.map((props, idx) => (
                <Card key={idx} {...props} />
            ))}
            </div>
        </div>
    );
}

function Card({title, buttonLink, imageLink, text}) {
    return (
      <div className={clsx('col cardStyle animate__animated animate__fadeInBottomLeft')}>
        <div className="text--center">
          <img src={imageLink} alt={title} style={{ maxWidth: '24rem' }}/>
        </div>
        <div className="text--center padding-horiz--md">
          <h3>{title}</h3>
          <p>{text}</p>
          <Button variant="primary" src={buttonLink}>Go somewhere</Button>
        </div>
      </div>
    );
  }
export default CustomServices;
